import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './Components/home/home.component';
import { MasterOrderComponent } from './Components/master-order/master-order.component';
import { AboutComponent } from './Components/about/about.component';
import { ErrorComponent } from './Components/error/error.component';

const routes: Routes = [
{ path: '', redirectTo: '/home', component: HomeComponent  }, // ✅ إعادة توجيه للمسار home فقط
{ path: 'home', component: HomeComponent },           // ✅ المسار الفعلي للـ Home
{ path: 'order', component: MasterOrderComponent },
{ path: 'about', component: AboutComponent },
{ path: '**', component: ErrorComponent }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
